def computeJaccardSimilarity(graph1, graph2):
    nodes1 = set(graph1.nodes())
    nodes2 = set(graph2.nodes())

    intersection = nodes1.intersection(nodes2)
    union = nodes1.union(nodes2)

    similarity = len(intersection) / len(union)
    return similarity


